    @classmethod
    def __ShapeFunctions(cls, x, y):
        N = KratosMultiphysics.Vector(cls.num_nodes)
        N[0] = -(x+y)/2
        N[1] = (1+x)/2
        N[2] = (1+y)/2

        DN_DX = KratosMultiphysics.Matrix(cls.num_nodes, cls.block_size)
        DN_DX[0,0] = -0.5
        DN_DX[0,1] = -0.5
        DN_DX[1,0] =  0.5
        DN_DX[1,1] =  0
        DN_DX[2,0] =  0
        DN_DX[2,1] =  0.5

        return N, DN_DX

    @classmethod
    def __FillVector(cls, rows, value):
        v = KratosMultiphysics.Vector(rows)
        for r in range(rows):
            v[r] = value
        return v

